import { Routes, Route, Navigate } from 'react-router-dom'
import Dashboard from './components/Dashboard';
import './App.css';
import AboutMe from './components/AboutMe';

function App() {
  return (
    <div className="App">
      <Routes>
        <Dashboard />
        <AboutMe />
      </Routes>
    </div>
  );
}

export default App;
